import React from 'react';
import { Table, Button } from 'react-bootstrap';
import { BsPencil, BsFillTrashFill } from 'react-icon';


export const Cities = ({ cities }) => {
    if (!cities || cities.length == 0) {
        return <div></div>
    }

    return (
        <Table striped bordered hover className="App-table" responsive>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>District</th>
                    <th>Population</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
            </thead>
            <tbody>
                {cities.map(city =>
                    <tr>
                        <th className="App-table-body">{city.node.id}</th>
                        <th className="App-table-body">{city.node.name}</th>
                        <th className="App-table-body">{city.node.district}</th>
                        <th className="App-table-body">{city.node.population}</th>
                        <th className="App-table-body"><Button><BsPencil /></Button></th>
                        <th className="App-table-body"><Button><BsFillTrashFill /></Button></th>
                    </tr>
                )}
            </tbody>
        </Table>
    )
}
